pub enum XmlEvent {
    StartDocument {
            version: XmlVersion,
            encoding: String,
            standalone: Option<bool>,
        },
    EndDocument,
    ProcessingInstruction {
            name: String,
            data: Option<String>,
        },
    StartElement {
            name: OwnedName,
            attributes: Vec<OwnedAttribute>,
            namespace: Namespace,
        },
    EndElement {
            name: OwnedName,
        },
    CData(String),
    Comment(String),
    Characters(String),
    Whitespace(String),
}

pub enum ErrorKind {
    Syntax(Cow),
    Io(io::Error),
    Utf8(str::Utf8Error),
    UnexpectedEof,
}

pub enum XmlEvent<'a> {
    StartDocument {
            version: XmlVersion,
            encoding: Option<&'a str>,
            standalone: Option<bool>,
        },
    ProcessingInstruction {
            name: &'a str,
            data: Option<&'a str>,
        },
    StartElement {
            name: Name,
            attributes: Cow,
            namespace: Cow,
        },
    EndElement {
            name: Option<Name>,
        },
    CData(&'a str),
    Comment(&'a str),
    Characters(&'a str),
}
